import React from 'react';

import { IStore } from 'store/store';

interface TitleProps {
  store: IStore
}

class Title extends React.Component<TitleProps> {
  renderSignin() {
    if(this.props.store.isSignin) {
      return (
        <ul className="content" id="signin">
          <li>로그아웃</li>
        </ul>
      );
    } else {
      return (
        <ul className="content" id="signin">
          <li>로그인</li>
        </ul>
      );
    }
  }

  render() {
    return (
      <div>
        {this.renderSignin()}
        <div className="content bg-c-gray" id="title">
          <p>걱정없이 집을 나가자!</p>
          <h1>EASYWAY</h1>
        </div>
      </div>
    );
  }
}

export default Title;
